import { DataGrid, GridToolbar } from '@material-ui/data-grid';


const TableGrid = (props) => {


  return (
    <div style={{ height: 400, width: '100%'}}>
      <DataGrid rows={props.rows} columns={props.columns} pageSize={5}  />
    </div>
  );

}
export default TableGrid;
